import React from "react";
import "./App.css";
import {
  BrowserRouter as Router,
  Route,
  Redirect,
  Switch
} from "react-router-dom";

import Home from "./components/home.js";
import Manager from "./components/managerlogin";
import Employee from "./components/employeelogin";
import HR from "./components/hrlogin";
import Admin from "./components/adminlogin";

function App({ history }) {
  return (
    <div>
      <Router>
        <Switch history={history}>
          <Route exact path="/" component={Home} />
          <Route exact path="/home" component={Home} />
          <Route exact path="/managerlogin" component={Manager} />
          <Route exact path="/emplogin" component={Employee} />
          <Route exact path="/hrlogin" component={HR} />
          <Route exact path="/adminlogin" component={Admin} />
          <Redirect to="/404" />
        </Switch>
      </Router>
    </div>
  );
}

export default App;
